import React from 'react';
import { ReactComponent as NotificationSvg } from "../../../assets/icons/notifications.svg";
import { ReactComponent as LogoutSvg} from "../../../assets/icons/logout.svg";
import styles from "./nav.module.scss";
import styled from "styled-components";

const WhiteLogo = styled(NotificationSvg)`
  color: white;
`;

function Nav () {
    return(
        <nav className="header__navigation"> 
          <ul className="header__navigation-list"> 
            <li className="header__navigation-item"> 
              <WhiteLogo />
              <button className="header__navigation-button" type="button"> 
                <span className="visually-hidden"> Уведомления </span>
              </button>
            </li>

            <li className={styles.item}> 
              <LogoutSvg/>
              <button className="header__navigation-button" type="button"> 
                <span className="visually-hidden"> Выйти </span>
              </button>
            </li>

          </ul>
        </nav>
    );
}

export default Nav;
